import { useState, useEffect } from "react";
import axios from 'axios';

const UseFetchExchange2 = (cur0, cur1) => {

    const [data, setData] = useState(null);

    // const options = {
    //     method: 'GET',
    //     url: 'https://openexchangerates.org/api/latest.json',
    //     params: {
    //         app_id: '01341f5261444649a612793df73c7130'
    //     },
    // };
    console.log('111111-------------------');
    console.log(data);

    const fetchData = async () => {
        try {
            const response = await axios.get('https://openexchangerates.org/api/latest.json?app_id=01341f5261444649a612793df73c7130');
            setData(response.data);
        } catch (error) {
            console.error(error);
        }
    };

    useEffect(() => {
        fetchData();
    }, [cur0, cur1]);

    return data;
}

export default UseFetchExchange2;
